import React, {useState, useEffect} from 'react';

import EmployeeService from '../services/EmployeeService';
import {useParams} from 'react-router-dom';

const ViewEmployeeComponent = () => {

    const [employeeFirstName, setEmployeeFirstName] = useState('')
    const [employeeCode,setEmployeeCode]=useState('');
    const [employeeLastName, setEmployeeLastName] = useState('')
    const [emailId, setEmailId] = useState('')
    const {id} = useParams();
    const employee = { employeeFirstName, employeeCode,employeeLastName, emailId };


    useEffect(() => {

        EmployeeService.getEmployeeById(id).then((response) =>{
            setEmployeeFirstName(response.data.employeeFirstName)
            setEmployeeLastName(response.data.employeeLastName)
            setEmployeeCode(response.data.employeeCode)
            setEmailId(response.data.emailId)
        }).catch(error => {
            console.log(error)
        })
    }, [id])

        

    return (
        <div className = "container">
            <h2 className = "text-center"> List Employees </h2>
            
            <table className="table table-bordered table-striped">
                <thead>
                    <th> Employee Id </th>
                    <th> Employee Code </th>
                    <th> Employee First Name </th>
                    <th> Employee Last Name </th>
                    <th> Employee Email Id </th>
                    <th> Actions </th>
                </thead>
                <tbody>
                                         
                            <tr key = {employee.id}> 
                                <td> {employee.id} </td>
                                <td> {employee.employeeCode}</td>
                                <td>{employee.employeeFirstName}</td>
                                <td>{employee.employeeLastName}</td>
                                <td>{employee.emailId}</td>
                                
                            </tr>
                        
                    
                </tbody>
            </table>
        </div>
    )
}
export default ViewEmployeeComponent
